import React, { Component } from 'react';
import "../css/shopitems.min.css"
class ShopItems extends Component {
    state={
        // array: ['pierwszy','drugi','trzeci','cztery','piaty','szosty','siodmy','ósmy','dziewiąty','dziesiąty']
    }
    render() {
        const array= ['pierwszy','drugi','trzeci','cztery','piaty','szosty','siodmy','ósmy','dziewiąty','dziesiąty']
        const listItems=array.map((item)=>
        <div className="shop__items__elements">
            <li>{item}</li>
        </div>
        )
        return (
            <div className="shop__items">
                <h1>Tu bedą itemy</h1>
                    {listItems}
            </div>
        );
    }
}

export default ShopItems;
